import "./home.css";
import Header from "../../components/header/Header";
import Posts from "../../components/post/Posts";
import SideBar from "../../components/sidebar/SideBar";

export default function Home() {
  return (
    <div className="home">
      <Header />
      <div className="home">
        <Posts />
        <Sidebar />
      </div>
    </div>
  );
}
